import React from "react"

class DeletePage extends React.Component{
    render() {
        let hotelButton
        let roomButton
        let customerButton
        let employeeButton
        if(this.props.delete === true){
            hotelButton = <input type={"submit"} value={"Delete Hotel"}/>
            roomButton = <input type={"submit"} value={"Delete Room"}/>
            customerButton = <input type={"submit"} value={"Delete Customer"}/>
            employeeButton = <input type={"submit"} value={"Delete Employee"}/>
        }else{
            hotelButton = <input type={"submit"} value={"Update Hotel"}/>
            roomButton = <input type={"submit"} value={"Update Room"}/>
            customerButton = <input type={"submit"} value={"Update Customer"}/>
            employeeButton = <input type={"submit"} value={"Update Employee"}/>
        }

        return(
            <div>
                <div>
                    Room Id: <input type={"text"} id={"roomId"}/><br/>
                    {roomButton}
                </div>
                <div>
                    Hotel Id: <input type={"text"} id={"hotelId"}/><br/>
                    {hotelButton}
                </div>
                <div>
                    Customer SIN: <input type={"text"} id={"customerSIN"}/><br/>
                    {customerButton}
                </div>
                <div>
                    Employee SIN: <input type={"text"} id={"employeeSIN"}/><br/>
                    {employeeButton}
                </div>

            </div>
        )
    }
}

export default DeletePage
